// Add Services to Packages
export const INFO_DIALOG = {
    UISettings: {
        infoDialog: {
            open: false,
            displayType: 1,
            title: "Forgot Password",
            text: "Please contact the administrator for password reset.",
            heading: null,
            image: null,
            maxWidth: 'xs'
        }
    }
};
